import "./App.css";

import ImgLogo from "./img/logo512.png";
function App() {
  return (
    <div className=" bg-gradient-to-r from-slate-900 via-slate-800 to-slate-700 ">
      <div className="bg-slate-600 text-center m-auto p-8 drop-shadow-4xl hover:drop-shadow-xl rounded-tl-full rounded-br-full hover:rounded-tr-full transition-all duration-500 ease-in-out w-24 max-w-xl flex">
        <img
          src={ImgLogo}
          width={50}
          height={50}
          alt="Nothing Here"
          className="mx-auto w-1/2"
        />
        <p className=" text-slate-50 w-1/2 ">My Ffirst</p>
      </div>
    </div>
  );
}

export default App;
